INSERT INTO `book` VALUES (16,'That\'s Not My Name','Megan Lally','<div><div><b style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-weight: bold; scrollbar-width: thin; scrollbar-color: rgb(162, 162, 162) transparent;\">An instant bestseller!</b></div><div><b style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-weight: bold; scrollbar-width: thin; scrollbar-color: rgb(162, 162, 162) transparent;\">She thought she had her life back. She was wrong. A gripping debut thriller perfect for fans of Natalie D. Richards and Vincent Ralph.</b></div><div><i style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); scrollbar-width: thin; scrollbar-color: rgb(162, 162, 162) transparent;\">It was a mistake to trust him.</i></div><div>Shivering and bruised, a teen wakes up on the side of a dirt road with no memory of how she got there&#8213;or who she is. A passing officer takes her to the police station, and not long after, a frantic man arrives. He\'s been searching for her&nbsp;<i style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); scrollbar-width: thin; scrollbar-color: rgb(162, 162, 162) transparent;\">for hours</i>. He has her school ID, her birth certificate, and even family photos.</div><div>He is her father. Her name is Mary. Or so he says.</div><div>When Lola slammed the car door and stormed off into the night, Drew thought they just needed some time to cool off. Except Lola disappeared, and the sheriff, his friends, and the whole town are convinced Drew murdered his girlfriend. Forget proving his innocence, he needs to find&nbsp;<i style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); scrollbar-width: thin; scrollbar-color: rgb(162, 162, 162) transparent;\">her</i>&nbsp;before it\'s too late. The longer Lola is missing, the fewer leads there are to followand the more danger they both are in.</div></div>','9781728270111',_binary '\\\0JFIF\0\0\0\0\0\0\\0C\0\n\n\n		\n\Z%\Z# , #&\')*)-0-(0%()(\\0C\n\n\n\n(\Z\